import React, {Component} from 'react';
import TodoList from './components/TodoList';
import './App.css'

class App extends Component{
  render(){
    return(
      <div className="container">
        <h1>Lista de Tarefas</h1>
        <TodoList/>
      </div>
    );
  }
}

export default App;
